FILENAME = 'pokestopdata2.txt'

def getDict():
    file = open(FILENAME, 'r')
    string = file.read()
    string = string.replace('{', ',')
    string = string.replace('\n', ',')
    string= string.split(',')
    string = [thing for thing in string if thing != '']
    #print(string)
    file.close
    pokeDict = {}
    for ind in range(0, len(string), 3):
        pokeDict[string[ind]] = (float(string[ind + 2]),float(string[ind + 1]),0.0)
    #print(pokeDict)
    KMLDict= kmlPokeDict.getKMLStops()
    return KMLDict, pokeDict

def getDistance(startPoint, endPoint, dictionary):
    return ((startPoint[0] - endPoint[0])**2 + (startPoint[1] - endPoint[1])**2)**0.5

def getDistDict( pokeDict ):
    distDict = {}
    for start in pokeDict.keys():
        for end in pokeDict.keys():
            if start != end and (start,end) not in distDict.keys():
                dist = getDistance(pokeDict[start], pokeDict[end], pokeDict)
                distDict[(start,end)] = dist
                distDict[(end,start)] = dist
    return distDict
 
def travellingSalesmanGreedy(distDict, pokeDict, start= None, visited = [], travelDict = {}):
    if start == None:
        start = list(pokeDict.keys())[0]
    closestStop = None
    visited.append(start)
    f = lambda x: travellingSalesmanGreedy(distDict, pokeDict, x, visited)
    
    maxDist = None
    maxElem = None
    fiveClosestStops = []

    if len(visited) + 5 >= len(pokeDict):
        return [([start, stop], getDistance(pokeDict[start], pokeDict[stop],distDict)) for stop in pokeDict if stop not in visited]
    for elem in pokeDict.keys():
        if elem not in visited:
            if len(fiveClosestStops) < 5:
                fiveClosestStops.append(elem)
                if maxDist == None:
                    maxElem = elem
                    maxDist = distDict[(start, elem)]
                elif maxDist < distDict[(start, elem)]:
                    maxDist = distDict[(start, elem)]
                    maxElem = elem
            else:
                if maxDist < distDict[(start, elem)]:
                    maxDist = distDict[(start, elem)]
                    fiveClosestStops.append(elem)
                    fiveClosestStops = [stop for stop in fiveClosestStops if stop != maxElem]
                    maxElem = elem
    possiblePaths = map(f, fiveClosestStops)

    shortestPath = None
    for path in possiblePaths:
        if not shortestPath:
            shortestPath = path
        else:
            if path[1] < shortestPath[1]:
                print(path)
                shortestPath = path
    return [([start] + shortestPath[0], shortestPath[1] + getDistance(pokeDict[start], pokeDict[shortestPath[0][0]], distDict))]

            


