def canRemove(value_to_remove, distDict):
    node1, node2 = None, None
    for nodes, dist in distDict.items():
        if value_to_remove == dist:
            node1 = nodes[0]
            node2 = nodes[1]

    counter1 = 0
    counter2 = 0
    if node1:
        for names in distDict.keys():
            if names[0] == node1:
                counter1 += 1
            if names[0] == node2:
                counter2 += 1
    if counter1 > 4 and counter2 > 4:
        return True
    return False

